package com.arraypractice;

public class Arrays2AddAllValues {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int arr[]= {23,45,67,78,89,78};
		
		int sum=0;
		for(int i=0;i<arr.length;i++) {
			sum=sum+arr[i];
			
		}
		System.out.println(sum);

	}

}
